u[i]))\n  }\n  \n  return(l)\n}\n\n\ngradient = function(x_sub,y,beta) {\n  g= rep(0,ncol(x_sub))\n  u = exp(x_sub %*% beta) / (1 + exp(x_sub %*% beta))\n  \n  for (i in 1:nrow(x_sub)) {\n    g = g + x_sub[i,]*(u[i]-y[i])\n  }\n  return(as.matrix(g))\n}\n\nhessian = function(x_sub,y,beta) {\n  u = exp(x_sub %*% beta) / (1 + exp(x_sub %*% beta))\n  h = matrix(0,ncol(x_sub),ncol(x_sub))\n  xtx = t(x_sub) %*% x_sub\n  \n  for (i in 1:nrow(x_sub)) {\n    h = h + u[i]*(1-u[i]) * xtx \n  }\n  return(h)\n}\n\nnorm_vec <- function(x) sqrt(sum(x^2))\n\n\nrhapson_newton <- function(x,y,betaO,its) {\n  beta = betaO\n  it=0\n  while(it<its)  {\n    lglik = loglikl(x_sub = x,y = y,beta = beta)\n    grd= gradient(x_sub = x,y = y,beta = beta)\n    hes= hessian(x_sub = x,y = y,beta = beta)\n    dir = chol2inv(chol(hes)) %*% grd\n    beta = beta - dir\n    it = it + 1\n  }\n  return(beta)\n}\n","normpath":"/home/hugoboum/Documents/Parallel Computing/Project/aux_fcts_2b.R"}],"prof_output":"/home/hugoboum/Documents/Parallel Computing/Project/.Rproj.user/99588069/profiles-cache/file6a862bac4608.Rprof","highlight":{"output":["^output\\$"],"gc":["^<GC>$"],"stacktrace":["^\\.\\.stacktraceo(n|ff)\\.\\.$"]},"split":"h"}},"evals":[],"jsHooks":[]}</script>
